    if (tokenUsers) setUsers(true);
    else setUsers(false);
  }, [users]); */
  return (
    <BrowserRouter>
      <RouterLogin />
      <ProtectedRoutes users={users}>
        <RouterMain />
      </ProtectedRoutes>
      <ProtectedRoutes users={users}>
        <RouterPerson />
      </ProtectedRoutes>
    </BrowserRouter>
  );
};
